import "./Card.css";
// import Button from "./Button";

export default function Card(props) {
  return (
    <div className="card">
      <div className="image-container">
        <img
          className="image"
          src="https://hotpotmedia.s3.us-east-2.amazonaws.com/8-iebaKTHQCjr6Eyn.png?nc=1"
          alt="#"
        />
      </div>
      <div className="card_content">
        <h2>Level 1</h2>
        <Button
          classNameBtn="btn"
          href="https://maimaiokinawa.github.io/fruits_mes/"
          label="test"
        />
      </div>
    </div>
  );
}
